import React from "react";
import { CSSTransition } from "react-transition-group";
import "./SideDrawer.css";

const SideDrawer = ({ children, show })=>{
    return(
        <CSSTransition 
            on={show} 
            timeout={200} 
            classNames="slide-in-left" 
            mountOnEnter 
            unmountOnExit
            >
                <aside className="side-drawer">
                    { children }
                </aside>
        </CSSTransition>
    )
}

export default SideDrawer;
